// finds the next state of the fsm depending on the current state
enum State ControlPath(enum State CURRENT_STATE, int cursor_x, int cursor_y, enum Planet planet, VGA *vga)
{
    enum State NEXT_STATE = CURRENT_STATE;
     //CONTROL PATH
    switch(CURRENT_STATE)
    {
        case TITLE:
            if (ENTER_PRESSED)
            {
                NEXT_STATE = IDLE;
                changeState(IDLE, planet, vga);
                ENTER_PRESSED = false;
            }
            break;
        case IDLE:
            if(ENTER_PRESSED)
            {
                ENTER_PRESSED = false;
                if (cursor_x > 8 && cursor_x < 58 && cursor_y > 86 && cursor_y < 98)
                {
                    NEXT_STATE = CHANGE_ANGLE;
                    changeState(CHANGE_ANGLE, planet, vga);
                }

                //if the x y position are where the change speed bar is
                if(cursor_x > 8 && cursor_x < 58 && cursor_y > 106 && cursor_y < 118)
                {
                    NEXT_STATE = CHANGE_SPEED;
                    changeState(CHANGE_SPEED, planet, vga);
                }

                //if the x y position are where the change mass bar is
                if (cursor_x > 8 && cursor_x < 58 && cursor_y > 126 && cursor_y < 138)
                {
                    NEXT_STATE = CHANGE_MASS;
                    changeState(CHANGE_MASS, planet, vga);
                }

                //if the x y position are where the launch rocket button is
                // NEXT_STATE = ROCKET_READY;

                //if the x y position are where the change planet button is
                if (cursor_x > 280 && cursor_x < 320 && cursor_y > 0 && cursor_y < 12)
                {
                    NEXT_STATE = CHANGE_PLANET;
                    changeState(CHANGE_PLANET, planet, vga);
                }
                //if the x y position are where the launch button is
                if (cursor_x > 0 && cursor_x < 85 && cursor_y > 146 && cursor_y < 176)
                {
                    if (switches->data == 0b1111111111)
                    {
                        CURRENT_DOUBLE_MASS = atof(CURRENT_TEXT_MASS);
                        CURRENT_DOUBLE_SPEED = atof(CURRENT_TEXT_SPEED);
                        NEXT_STATE = ROCKET_READY;  
                        changeState(ROCKET_READY, planet, vga);
                    } 
                }
            }
            break;
            
        case CHANGE_ANGLE:
            //if the user presses enter while typing, it will take them out of the state and put them into the start state
            if(ENTER_PRESSED)
            {
                //make sure the user entered a valid string
                if(checkStringValid(CURRENT_TEXT_ANGLE, CHANGE_ANGLE))
                {
                    if (checkAngleValue(CURRENT_TEXT_ANGLE))
                    {
                        NEXT_STATE = IDLE;
                        ROCKET_START_ANGLE = atof(CURRENT_TEXT_ANGLE);
                        changeState(IDLE, planet, vga);
                    }
                }
                ENTER_PRESSED = false;
            }
            break;

        case CHANGE_SPEED:
            //if the user presses enter while typing, it will take them out of the state and put them into the start state
            if(ENTER_PRESSED)
            {
                if(checkStringValid(CURRENT_TEXT_SPEED, CHANGE_SPEED))
                {
                    NEXT_STATE = IDLE;
                    changeState(IDLE, planet, vga);
                    
                }
                ENTER_PRESSED = false;
            }
            break;

        case CHANGE_MASS:
                //if the user presses enter while typing, it will take them out of the state and put them into the start state
            if(ENTER_PRESSED)
            {
                if(checkStringValid(CURRENT_TEXT_MASS, CHANGE_MASS))
                {
                    NEXT_STATE = IDLE;
                    changeState(IDLE, planet, vga);
                }
                ENTER_PRESSED = false;
            }
            break;
        
        case CHANGE_PLANET:
            if (ENTER_PRESSED)
            {
                enum Planet new_planet;
                if (cursor_x > 280 && cursor_x < 320 && cursor_y > 12 && cursor_y < 24)
                    new_planet = 0;
                else if (cursor_x > 280 && cursor_x < 320 && cursor_y > 24 && cursor_y < 36)
                    new_planet = 1;
                else if (cursor_x > 280 && cursor_x < 320 && cursor_y > 36 && cursor_y < 48)
                    new_planet = 2;
                else if (cursor_x > 280 && cursor_x < 320 && cursor_y > 48 && cursor_y < 60)
                    new_planet = 3;
                else 
                    new_planet = planet;
                NEXT_STATE = IDLE;
                ENTER_PRESSED = false;
                changeState(IDLE, new_planet, vga);
            }
            break;
        case ROCKET_READY:
            #ifdef AUDIO
            if(COUNTDOWN_INDEX == 28212)
            {
                NEXT_STATE = ROCKET_LAUNCH;
                changeState(ROCKET_LAUNCH, planet, vga);

            }
            #endif
            #ifndef AUDIO
            NEXT_STATE = ROCKET_LAUNCH;
            changeState(ROCKET_LAUNCH, planet, vga);
            #endif
            break;
        case ROCKET_LAUNCH:
            if (ANIMATION_ROCKET_HEIGHT <= -90)
            {
                NEXT_STATE = ROCKET_PATH;
                changeState(ROCKET_PATH, planet, vga);
            }
            break;
        case ROCKET_PATH:
            if (PATH_ROCKET_CRASHED || PATH_ROCKET_SUCCESS)
            {
                NEXT_STATE = PATH_ROCKET_CRASHED ? ROCKET_CRASH : END;
                changeState(NEXT_STATE, planet, vga);
            }
            break;
        case ROCKET_CRASH:
            if(ENTER_PRESSED)
            {
                NEXT_STATE = IDLE;
                ENTER_PRESSED = false;
                reset();
                changeState(IDLE, planet, vga);
            }
            break;
        case END:
            if(ENTER_PRESSED)
            {
                NEXT_STATE = IDLE;
                ENTER_PRESSED = false;
                reset();
                changeState(IDLE, planet, vga);
            }
            break;
        default:
            NEXT_STATE = CURRENT_STATE;
            break;
    }
    return NEXT_STATE;
}

void changeState(enum State next_state, enum Planet planet, VGA *vga)
{   
    voidScreen(BLACK);

    plotBackground(next_state, planet);

    wait_for_v_sync(vga);
    pixel_buffer_start = vga->back_buffer;

    plotBackground(next_state, planet);

    wait_for_v_sync(vga);

    clearCharacters(' ');

    CURRENT_PLANET = planet;

    //read the curreNt scene 
    for (int x = 0; x < 320; x++)
        for (int y = 0; y < 240; y++)
            CurrentSceneDefault[x][y] = readPixel(x, y);
}

void eraseCursor()
{
    //clear cursor from two frames ago:
    for (int i = 0; i < 16; i++)
        for (int j = 0; j < 16; j++)
            plotPixel(previousFrame[1][0] + i, previousFrame[1][1] + j, CurrentSceneDefault[previousFrame[1][0] + i][previousFrame[1][1] + j]);
          
}

void initializeVGA(VGA *vga)
{
    //set the resolution to 320 x 240
    assert(vga->x_res == 320);
    assert(vga->y_res == 240);

    //set buffer 1 to the back buffer
    vga->back_buffer = (int) &Buffer1;
    //wait for buffer swap
    wait_for_v_sync(vga);
    //initialize the pointer to the pixel buffer
    pixel_buffer_start = vga->front_buffer;
    voidScreen(BLACK);

    //set buffer 2 to the back buffer
    vga->back_buffer = (int) &Buffer2;
    //set the pixel_buffer_start to the back (drawing) buffer
    pixel_buffer_start = vga->back_buffer;
    voidScreen(BLACK);
    clearCharacters(' ');
}

void wait_for_v_sync(VGA *vga)
{
    vga->front_buffer = 1; //start the synchronization process
    while (vga->status & 0x01);
}

void plotPixel(int x, int y, short int color)
{
    if (x > 320 || x < 0 || y > 240 || y < 0) return;
    volatile short int *pixel_address = (short int *) (pixel_buffer_start + (y << 10) + (x << 1));
    *pixel_address = color;
}

short readPixel(int x, int y)
{
    volatile short int *pixel_address = (short int *) (pixel_buffer_start + (y << 10) + (x << 1));
    return *pixel_address;
}

void plotBox(int x, int y, int width, int height, short int outline_color, short int fill_color)
{
    //loop through the width and height of the box, plot pixel 
    for(int i = 0; i < width; i++)
    {
        for(int j = 0; j < height; j++)
        {
            if(i == 0 || i == width - 1 || j == 0 || j == height - 1)
            {
                plotPixel(x + i, y + j, outline_color);
            }
            else
            {
                plotPixel(x + i, y + j, fill_color);
            }
        }
    }
}

void plotCircle(int x, int y, int radius, short int outline_color)
{
    for(double angle = 0; angle <= 360; angle++)
    {
        plotPixel(x + cos(angle/(2 * M_PI)) * radius, y + sin(angle/(2 * M_PI)) * radius, outline_color);
    }

}

void plotLine(int x1, int y1, int x2, int y2, short color)
{
    //use Breseham's line algorithm to plot the line using plotPixel()
    int dx = abs(x2 - x1);
    int dy = abs(y2 - y1);

    int sx = x1 < x2 ? 1 : -1;
    int sy = y1 < y2 ? 1 : -1;

    int err = dx - dy;

    while (true)
    {
        plotPixel(x1, y1, color);

        if (x1 == x2 && y1 == y2)
            break;

        int e2 = 2 * err;

        if (e2 > -dy)
        {
            err -= dy;
            x1 += sx;
        }

        if (e2 < dx)
        {
            err += dx;
            y1 += sy;
        }
    }
}

void voidScreen(short int color)
{   
    //clear the video buffer
    for (int x = 0; x < X_RES; x++)
        for (int y = 0; y < Y_RES; y++)
            plotPixel(x, y, color);
}

void plotLetter(int x, int y, char letter)
{
    assert(x >= 0);
    assert(y >= 0);
    assert(x <= 79);
    assert(y <= 59);

    char* character_buffer = (char*) 0x09000000;

    //print the x and y coordinates
    // printf("X: %d, Y: %d\n", x, y);

    char* character_address = (char*) (character_buffer + (y << 7) + x);

    // printf("Character address: %x\n", character_address);

    *character_address = letter;
}

void plotString(const int init_x, const int init_y, char *string)
{
    //asserts
    assert(init_x >= 0);
    assert(init_y >= 0);
    assert(init_x <= 79);
    assert(init_y <= 59);

    int x;
    int y;
    //loop through string
    for (int i = 0; string[i] != '\0'; i++)
    {
        x = init_x + i;
        y = init_y;
        //check if x is out of bounds, if so move it to 0
        if (x > 79)
        {
            x = x % 80;
            y++;
        }
        //check bounds for y
        if (y == 60)
            y = 0;

        plotLetter(x, y, string[i]);
    }
}

void plotBackground(enum State state, enum Planet planet)
{   
    if (state == TITLE)
    {
        for (int y = 0; y < Y_RES; y++)
            for (int x = 0; x < X_RES; x++)
                plotPixel(x, y, title[X_RES * y + x]);
        
        return;
    }

    if (state == ROCKET_PATH)
    {
        //draw grid 
        for (int y = 0; y < Y_RES; y++)
            for (int x = 0; x < X_RES; x++)
                plotPixel(x, y, grid[X_RES * y + x]);
        return;
    }

    if (state == END)
    {
        voidScreen(BLACK);
        plotCircle(160, 120, 100, WHITE);
        return;
    }

    for (int y = 0; y < Y_RES; y++)
    {
        for (int x = 0; x < X_RES; x++)
        {
            switch (planet)
            {
                case MARS:
                    plotPixel(x, y, mars[X_RES * y + x]);
                    break;
                case MOON:
                    plotPixel(x, y, moon[X_RES * y + x]);
                    break;  
                case DARSAN:
                    plotPixel(x, y, darsanplanet[X_RES * y + x]);
                    break;
                case EARTH:
                    plotPixel(x, y, earth[X_RES * y + x]);
                    break;
                default:
                    return;
            }
        }
    }

    if (state == ROCKET_CRASH)
    {
        //plot the crash array
        for (int y = 0; y < Y_RES; y++)
            for (int x = 0; x < X_RES; x++)
                if (crash[X_RES * y + x] != 0x0)
                    plotPixel(x, y, crash[X_RES * y + x]);
    }
}

void plotRocket(const int x_offset, const int y_offset, double angle, const bool flame_on) 
{   

    for (int y = 0; y < 60; y++)
        for (int x = 0; x < 20; x++)
        {
            //dont draw if current pixel is white
            if (!flame_on && rocket[x + 20*y] != 0xffff)
                plotPixel(x + x_offset, y + y_offset, rocket[x + 20*y]);
            else if (flame_on && rocket_flame[x + 20*y] != 0xffff)
                plotPixel(x + x_offset, y + y_offset, rocket_flame[x + 20*y]);
        }

    return;
    //plot the angle line from the top of the rocket
    //determine the end point of the line depending on the top
    if (angle == 0) return;

    int x1 = x_offset + 10, y1 = y_offset;
    int x2 = x_offset + 10 + 32 * cos(angle), y2 = y_offset - 32 * sin(angle);

    plotLine(x1, y1, x2, y2, WHITE);
}

