void getKeyBoardData(char *CURRENT_TEXT, enum State CURRENT_STATE)
{
    int CURRENT_TEXT_IDX;
    if(CURRENT_STATE == CHANGE_ANGLE)
    {
        CURRENT_TEXT_IDX = ANGLE_IDX;
    }
    if(CURRENT_STATE == CHANGE_SPEED)
    {
        CURRENT_TEXT_IDX = SPEED_IDX;
    }
    if(CURRENT_STATE == CHANGE_MASS)
    {
        CURRENT_TEXT_IDX = MASS_IDX;
    }
    

    int read_valid = keyboard->RVALID & 0b10000000;
    if(read_valid)
    {
        //get the make code and determine which char to return
        int PS2_data = keyboard->data;
        BYTE0 = BYTE1;
        BYTE1 = BYTE2;
        BYTE2 = PS2_data;
    }
    //this means that a key has been released
    if (BYTE1 == 0xF0) 
    {
        switch (BYTE2) 
        {
            case 0x16: // one pressed
                if(CURRENT_TEXT_IDX >= 9)
                    break;
                if(READY_TO_READ)
                {
                    READY_TO_READ = false;
                    CURRENT_TEXT[CURRENT_TEXT_IDX] = '1';
                    (CURRENT_TEXT_IDX)++;
                }
                
                break;
            case 0x1E: // two pressed
                if(CURRENT_TEXT_IDX >= 9)
                    break;
                if(READY_TO_READ)
                {
                    READY_TO_READ = false;
                    CURRENT_TEXT[CURRENT_TEXT_IDX] = '2';
                    (CURRENT_TEXT_IDX)++;
                }
                
                break;
            case 0x26: // three pressed
                if(CURRENT_TEXT_IDX >= 9)
                    break;
                if(READY_TO_READ)
                {
                    READY_TO_READ = false;
                    CURRENT_TEXT[CURRENT_TEXT_IDX] = '3';
                    (CURRENT_TEXT_IDX)++; 
                }
                
                break;
            case 0x25: // four pressed
                if(CURRENT_TEXT_IDX >= 9)
                    break;
                if(READY_TO_READ)
                {
                    READY_TO_READ = false;
                    CURRENT_TEXT[CURRENT_TEXT_IDX] = '4';
                    (CURRENT_TEXT_IDX)++;
                }
                
                break;
            case 0x2E: // five pressed
                if(CURRENT_TEXT_IDX >= 9)
                    break;
                if(READY_TO_READ)
                {
                    READY_TO_READ = false;
                    CURRENT_TEXT[CURRENT_TEXT_IDX] = '5';
                    (CURRENT_TEXT_IDX)++;
                }
                
                break;
            case 0x36: // six pressed
                if(CURRENT_TEXT_IDX >= 9)
                    break;
                if(READY_TO_READ)
                {
                    READY_TO_READ = false;
                    CURRENT_TEXT[CURRENT_TEXT_IDX] = '6';
                    (CURRENT_TEXT_IDX)++;
                }
                
                
                break;
            case 0x3D: // seven pressed
                if(CURRENT_TEXT_IDX >= 9)
                    break;
                if(READY_TO_READ)
                {
                    READY_TO_READ = false;
                    CURRENT_TEXT[CURRENT_TEXT_IDX] = '7';
                    (CURRENT_TEXT_IDX)++;
                }
                break;
            case 0x3E: // eight pressed
                if(CURRENT_TEXT_IDX >= 9)
                    break;
                if(READY_TO_READ)
                {
                    READY_TO_READ = false;
                    CURRENT_TEXT[CURRENT_TEXT_IDX] = '8';
                    (CURRENT_TEXT_IDX)++;
                }
                
                
                break;
            case 0x46: // nine pressed
                if(CURRENT_TEXT_IDX >= 9)
                    break;
                if(READY_TO_READ)
                {
                    READY_TO_READ = false;
                    CURRENT_TEXT[CURRENT_TEXT_IDX] = '9';
                    (CURRENT_TEXT_IDX)++;
                }
            
            case 0x45: //zero pressed
                if(CURRENT_TEXT_IDX >= 9)
                    break;
                if(READY_TO_READ)
                {
                    READY_TO_READ = false;
                    CURRENT_TEXT[CURRENT_TEXT_IDX] = '0';
                    (CURRENT_TEXT_IDX)++;
                }
                
                
                break;
            case 0x49: // period ' . ' pressed
                if(CURRENT_TEXT_IDX >= 9)
                    break;
                if(READY_TO_READ)
                {
                    READY_TO_READ = false;
                    CURRENT_TEXT[CURRENT_TEXT_IDX] = '.';
                    (CURRENT_TEXT_IDX)++;
                }
                
                
                break;
  
                
                break;
            case 0x66: // backspace pressed
                if(CURRENT_TEXT_IDX <= 0)
                {
                    break;
                }
                if(READY_TO_READ)
                {
                    READY_TO_READ = false;
                    CURRENT_TEXT_IDX = CURRENT_TEXT_IDX - 1;
                    CURRENT_TEXT[CURRENT_TEXT_IDX] = ' ';
                }
                break;


            //enter pressed
            case 0x5A:
                if(READY_TO_READ)
                {
                    READY_TO_READ = false;
                    ENTER_PRESSED = true;
                }
                break;
            default:
                break;
        }
    }
    else
    {
        switch(BYTE2)
        {
            //w key pressed
            case 0x1D:
                Y_POSITION -= 2;
                if(Y_POSITION <= 0)
                    Y_POSITION = 0;
                break;
            //s key pressed
            case 0x1B: 
                Y_POSITION += 2;
                if(Y_POSITION >= 240)
                    Y_POSITION = 240;
                break;

            //a key pressed
            case 0x1C:
                X_POSITION -= 2;
                if(X_POSITION <=0)
                {
                    X_POSITION = 0;
                }
                break;

            //d key pressed
            case 0x23:
                X_POSITION += 2;   
                if(X_POSITION >=320)
                {
                    X_POSITION = 320;
                }
                break;
        }
        READY_TO_READ = true;
  
    }
    
    *RLEDs = BYTE2;

    if(CURRENT_STATE == CHANGE_ANGLE)
    {
        ANGLE_IDX = CURRENT_TEXT_IDX ;
    }
    if(CURRENT_STATE == CHANGE_SPEED)
    {
        SPEED_IDX = CURRENT_TEXT_IDX;
    }
    if(CURRENT_STATE == CHANGE_MASS)
    {
        MASS_IDX = CURRENT_TEXT_IDX;
    }
    
}

