//function that takes in a char array and determines if there is more than 1 "." char or "-" char in the array
bool checkStringValid(char *string, enum State CURRENT_STATE)
{
    int period_count = 0;
    int index = 0;
    while(1)
    {
        if(string[index] == ' ')
        {
            if(string[index - 1] == '.')
            {
                return false;
            }
            break;
        }
        if(string[index] == '.')
        {
            period_count++;
        }
        index++;
    }
    if(period_count > 1)
    {
        return false;
    }
    return true;
}
